import { configureStore } from '@reduxjs/toolkit';
import appReducer from './features/app';
import setTokenReducer from './features/setToken'
import setUsersReducer from './features/loginUser'

export default configureStore({
    reducer: {
        app: appReducer,
        setToken: setTokenReducer,
        usersLogin: setUsersReducer,
    },
});
